import React, {Component} from 'react';
import Config from "../scripts/config";
import {Row,Col, Container, Button} from "react-bootstrap";
import {RangeStepInput,forceNumber} from 'react-range-step-input';




class Rossrv extends Component {
  state = {ros: null,
            value: 50
              };

  constructor(props){
    super(props);
    }
  // create a pose subscriber
  init_connection(){
    console.log("Establish map connection");

      try{
        this.state.ros = new window.ROSLIB.Ros();
        this.state.ros.connect(
          "ws://"+Config.ROSBRIDGE_SERVER_IP+":"+Config.RSOBRIDGE_PORT+""
        );
        console.log("In map components");
      }catch(error) {
        console.log("Connection problem in map components");
      }
    }

 componentDidMount(){
      this.init_connection();
    }

 onChange(e) {
      const newVal = forceNumber(e.target.value);
      this.setState({value: newVal});
   }

  render (){

    return(
        <div>
          <p>Here's an example RangeStepInput:</p>
          <RangeStepInput
              min={0} max={100}
              value={this.state.value} step={1}
              onChange={this.onChange.bind(this)}
          />
      </div> );
  }
}
export default Rossrv;
